import Reacrt from 'react'
import s from './Filters.module.css'

const Filters = (props) => {

    const data = []

    const setNewFilter = (key) => () => {
        let key
        for (const dataKey in props.filter) {
            key = dataKey
        }
        switch (key){
            case "id":
                props.setFilters({id: key === 'id' ? (props.filter[key] ? false : true) : false})
                break
            case "firstName":
                props.setFilters({id: key === 'firstName' ? (props.filter[key] ? false : true) : false})
                break
            case "lastName":
                props.setFilters({id: key === 'lastName' ? (props.filter[key] ? false : true) : false})
                break
            case "email":
                props.setFilters({id: key === 'email' ? (props.filter[key] ? false : true) : false})
                break
            case "phone":
                props.setFilters({id: key === 'phone' ? (props.filter[key] ? false : true) : false})
                break
            case "address":
                props.setFilters({id: key === 'address' ? (props.filter[key] ? false : true) : false})
                break
            case "description":
                props.setFilters({id: key === 'description' ? (props.filter[key] ? false : true) : false})
                break
        }
    }

    for (let key in props.data) {
        data.push(<td onClick={setNewFilter(key)} className={s.column}>{props.data[key]}</td>)
    }
    return (
        <tr>
            {data}
        </tr>
    )
}

export default Filters
